import React from "react";
import "./WorkItem.css";
import { Col, Container, Row } from "react-bootstrap";
function WorkItem({
  collapsedNumWords = 10,
  expandButtonText = "Show more",
  collapseButtonText = "Show less",
  buttonColor = "red",
  expanded = false,
  className = "",
  children,
}) {
  return (
    <div className="grid-item">
      <Row className="upper-item"></Row>
      <Row className="lower-item">
        <div className="work-item-heading">Backend work</div>
        <div className="work-item-description">
          Hybris based eccomerce project
        </div>
      </Row>
    </div>
  );
}

export default WorkItem;
